import React from 'react'
import { useDispatch, useSelector } from "react-redux";
import { remove } from "../redux/userSlice";

export default function LogOut() {

    const logout = (e) => {
        e.preventDefault();
        dispatch(remove());
    
        window.location = "/login";
      };

    return (
        <>
            <Nav.Link
                href="/login"
                data-toggle="tooltip"
                data-placement="bottom"
                title="Log Out"
                onClick={logout}
              >
                <i className="ti-share" />
              </Nav.Link>
        </>
    )
}
